min-version: '1.4'
class: ArcGISVector
sources:
  lpimap:
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: LPIMap
  lpimaplocal:
    host: mapsq.six.nsw.gov.au
    folder: sixmaps
    service: LPIMapLocal
  plan_section_lot:
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: Plan_Section_Lot
  rfs:
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: RFS
  hydrography:
    host: maps.six.nsw.gov.au
    folder: public
    service: NSW_Hydrography
  act-basic:
    host: data.actmapi.act.gov.au
    instance: arcgis
    folder: actmapi
    service: basic
  poi:
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: POI
  raster-labels:
    host: maps.six.nsw.gov.au
    folder: sixmaps
    service: LPI_RasterLabels_1
features:
  plantation-horticulture:
    name: Building_Large
    where:
    - classsubtype = 6
    - generalculturaltype IN (0,1,2,4)
    category: generalculturaltype
  urban-areas: Urban
  contours-10m:
    name: Contour_10m
    category:
    - relevance
    - classsubtype
    label: elevation
  contours-20m:
    name: Contour_20m
    category:
    - relevance
    - classsubtype
    label: elevation
  cliffs-excavation:
  - name: Cliffs_Reefs_Mangroves
    where: classsubtype = 11
    category: classsubtype
  - name: CliffTop_Levee
    where: classsubtype IN (1,3)
    category: classsubtype
  - source: poi
    name: Points Of Interest
    where: poitype = 'Cliff'
    category: poitype
    label-only: true
    label: poiname
  sand:
    name: Cliffs_Reefs_Mangroves
    where: classsubtype IN (6,7)
    category: classsubtype
  cadastre:
  - source: plan_section_lot
    name: Lot
    where: classsubtype = 1
  - source: act-basic
    name: Urban Registered
  - source: act-basic
    name: Rural Registered
  swamps-inundation:
  - name: Swamps_LSI
    category: classsubtype
  - source: poi
    name: Points Of Interest
    where: poitype = 'Swamp'
    label-only: true
    label: poiname
  watercourses:
  - source: hydrography
    name: Hydroline
    where:
    - classsubtype = 1
    - hydrotype NOT IN (5, 6)
    category:
    - relevance
    - hydrotype
  - source: lpimap
    name: Stream_Names
    category: relevance
    label-only: true
    label: hydronamestring
  stock-dams:
    name: StockDams
    category: hydrotype
  pondage:
    name: Building_Large
    where: classsubtype = 9
    category: generalculturaltype
  coastline:
    name: Oceans_Bays
    where: classsubtype = 3
    scale: 50000
  water-areas:
  - name: HydroArea
    category: perenniality
  - name: Oceans_Bays
    where: classsubtype = 3
    category: classsubtype
    scale: 50000
  - source: poi
    name: Points Of Interest
    where: poitype IN ('Natural Waterbody','Manmade Waterbody','Bay / Inlet / Basin','Reach / River Bend')
    category: poitype
    label-only: true
    label: poiname
  levees:
  - name: CliffTop_Levee
    where: classsubtype = 4
  - source: poi
    name: Points Of Interest
    where:
    - poitype = 'Reef'
    - poiname LIKE '% LEVEE'
    label-only: true
    label: poiname
  dam-batters:
    name: Building_Large
    where: classsubtype = 10
  dam-walls-spillways:
    name: Damwall_Racetrack
    where: classsubtype IN (4,7)
    category:
    - classsubtype
    - alternativelabel
  waterfalls:
    name: Waterfalls_springs
    # definition: ancillaryhydrotype = 6
    where: ancillaryhydrotype = 6
    rotate: symbolrotation
    label: generalname
  mangroves-intertidal:
    name: Cliffs_Reefs_Mangroves
    where: classsubtype IN (1,3)
    category: classsubtype
  reefs-rocks:
  - name: Cliffs_Reefs_Mangroves
    where: classsubtype IN (4,5)
    category: classsubtype
  # - name: Caves_Pinnacles
  #   definition: classsubtype IN (4,5)
  #   category: classsubtype
  - source: poi
    name: Points Of Interest
    where:
    - poitype = 'Reef'
    - poiname NOT LIKE '% LEVEE'
    category: poitype
    label-only: true
    label: poiname
  - source: poi
    name: Points Of Interest
    where: poitype = 'Rock Awash'
    category: poitype
    label-only: true
    label: poiname
  rocky-shore:
    name: CliffTop_Levee
    where: classsubtype IN (5,6)
    category: classsubtype
  breakwaters:
  - name: Damwall_Racetrack
    where: classsubtype = 5
    category: classsubtype
  - source: poi
    name: Points Of Interest
    where: poitype = 'Breakwater'
    label-only: true
    label: poiname
  caves-pinnacles:
    name: Caves_Pinnacles
    category: classsubtype
    label: generalname
    # definition: classsubtype IN (1,2,6)
  road-tunnels:
    source: rfs
    name: RoadSegment
    where:
    - operationalstatus NOT IN (3,8)
    - roadontype = 3
    - classsubtype <> 8
    category: functionhierarchy
  railway-tunnels:
    name: Railway_intunnel_LS
    where: operationalstatus NOT IN (3,8)
    category: classsubtype
  wharves-ramps-slipways:
    name: Wharfs_Ramps
    category: classsubtype
  runways:
    name: Runway
    category:
    - runwaydefinition
    - runwaysurface
  perimeters:
  - name: Damwall_Racetrack
    where: classsubtype = 6
    category:
    - classsubtype
    - generalculturaltype
  - name: Damwall_Racetrack
    where: classsubtype = 3
    category: classsubtype
  fences:
    name: Damwall_Racetrack
    where: classsubtype = 2
    category: classsubtype
  conveyors:
    name: Damwall_Racetrack
    where: classsubtype = 1
    category: classsubtype
  floodways:
    source: rfs
    name: RoadSegment
    where:
    - operationalstatus NOT IN (3,8)
    - roadontype = 4
    - classsubtype <> 8
    - functionhierarchy IN (1,2,3,4,5,6)
    category: functionhierarchy
  roads:
  - source: rfs
    name: RoadSegment
    where:
    - operationalstatus NOT IN (3,8)
    - roadontype <> 3
    - classsubtype <> 8
    category:
    - surface
    - classsubtype
    - functionhierarchy
    - roadontype
  - source: raster-labels
    name: Raster_Road_Labels
    where:
    - operationalstatus NOT IN (3,8)
    - functionhierarchy NOT IN (7,10,11)
    - functionhierarchy NOT IN (6) OR relevance < 6
    - roadnamestring NOT LIKE '%BICENTENNIAL NATIONAL%'
    - roadnamestring NOT LIKE '%AUSTRALIAN ALPS%'
    - roadnameoid IS NOT NULL
    category: functionhierarchy
    label-only: true
    label: roadnamestring
  - fallback: true
    source: lpimaplocal
    name: LS_RoadNameExtent_Labels
  railways:
    name: Railway_onground_LS
    where: operationalstatus NOT IN (3,8)
    category:
    - classsubtype
    - railontype
  road-bridges:
    source: rfs
    name: RoadSegment
    where:
    - operationalstatus NOT IN (3,8)
    - roadontype = 2
    - classsubtype <> 8
    category:
    - functionhierarchy
    - classsubtype
    - surface
  railway-bridges:
    name: Railway_onbridge_LS
    where:
    - operationalstatus NOT IN (3,8)
    - railontype = 2
    category: classsubtype
  gates-grids:
    name: Gates_Grids
    rotate: symbolrotation
    category: classsubtype
  tanks:
    source: rfs
    name: TankPoint
  buildings:
  - name: Dwellings_Buildings
    category: small
  - name: Building_Large
    where: classsubtype = 5
    category: large
  - source: poi
    name: Points Of Interest
    where:
    - poigroup = 1
    - poitype = 'Homestead' OR (poitype = 'Community Facility' AND poiname LIKE '% HUT')
    category: poitype
    label-only: true
    label: poiname
  railway-stations:
    source: rfs
    name: TransportFacilityPoint
    where: classsubtype = 6
  spot-heights:
    name: SpotHeight
    label: elevation
  beacons:
    name: Beacon_Tower
    where: classsubtype = 12
    label: generalname
  towers:
    name: Beacon_Tower
    where: classsubtype = 7
  yards-quarries-windmills:
    name: Beacon_Tower
    where:
    - classsubtype = 4
    - generalculturaltype IN (8,9,11,12)
    category: generalculturaltype
  state-border: State_Border
  relative-heights:
    name: RelativeHeight
    label-only: true
    label: relativeheight
  feature-names:
  - source: poi
    name: Points Of Interest
    where: poitype IN ('Gap / Pass / Saddle','Headland','Mountain/Hill/Peak','Peninsula / Spit','Plateau / Tableland','Island','Rapids','Sandbar / Shoal','Lock')
    category: poitype
    label-only: true
    label: poiname
  - name: Ridge_Beach
    where: generalname <> 'GREAT DIVIDING RANGE'
    category: fuzzylinefeaturetype
    label-only: true
    label: generalname
  place-names:
    source: lpimap
    name: PlacePoint_LS
    where:
    - generalname NOT LIKE '% HUT'
    - generalname NOT LIKE '% SWAMP'
    category: placetype
    label-only: true
    label: generalname

# POI/POI (PointOfInterest)
# (poigroup:poitype)
# (use for labelling and specific point feature icons)
# 1:Lighthouse
# 3:Camping Ground
# 3:Lookout
# 3:Observation Tower
# 3:Picnic Area

# missing:
# TankArea
# ElectricityTransmissionLine
# Cableway

relief-masks:
- water-areas.Perennial
- water-areas.SeaLike

intervals-contours:
  10: contours-10m
  20: contours-20m

