urban-areas:
  stroke: none
  fill: "#FFFABD"
contours-10m:
  bezier: 0.75
  stroke: "#805100"
  [ 1, 2 ]:
    stroke-width: 0.24
  [ 3, 4, 5, 6, 7, 8, 9, 10 ]:
    stroke-width: 0.12
